import React from 'react';
import styled from 'styled-components';
import GatherCards from '../common/gatherCards';
import GatherFilter from './gatherFilter';

const Wrapper = styled.div`
  font-family: Roboto;
  font-style: normal;
  margin-top: 100px; /* 간격 띄우기 */

  h2 {
    display: inline;
  }

  .gatherFilter {
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 20px;
    line-height: 23px;
    float: right;
    letter-spacing: -0.015em;
  }

  .boardCheckBox {
    margin-left: 5px;
    margin-right: 25px;
    cursor: pointer; /* 클릭시 boardCheckedBox로 변경 + 모집중인 카드만 표시 */
  }

  .gathers {
    margin-bottom: 50px;
  }

`;

const Cards = styled.section`
  display: flex;
  justify-content: space-between;
  margin-bottom: 50px;
`

const Gather = (props) => { // N개의 독서 모임
  return (
    <>
      <Wrapper>
        <div className="gathers">
          <h2>N개의 독서 모임</h2>
          <span className="gatherFilter">
              모집중<img src="assets/images/boardCheckBox.png" alt="checkbox" className="boardCheckBox" />
              <GatherFilter />
          </span>
        </div>
      </Wrapper>
      <Cards>
        <GatherCards />
        <GatherCards />
        <GatherCards />
      </Cards>
      <Cards>
        <GatherCards />
        <GatherCards />
        <GatherCards />
      </Cards>
      <Cards>
        <GatherCards />
        <GatherCards />
        <GatherCards />
      </Cards>
      
    </>
  )
};

export default Gather;
